import React from "react";
import { 
    Row,
    Col,
    Card,
    CardBody,

    Button

} from 'reactstrap'


const Product = ({history}) => {
    return (
        <>
            <Row>
                <Col xs="4">

                    <Button size="sm" onClick={() => history.push('/seller/product/add')}>Add New Product<sup> +</sup></Button>
                    {/* <Separator className="mb-5" /> */}
                </Col>
            </Row>
            <Row>

                <Col xxs="12" >
                    <Card className="my-4">
                        <CardBody>
                           {/*  <CustomTable columns={cols} data={tripTable} /> */}
                        </CardBody>
                    </Card>
                </Col>

            </Row>
        </>
    );
}

export default Product;
